import React from 'react'

const Table = ({ headerTitle, bodyTitle }) => {

  const headerResult = headerTitle.map((el) => {
    return <td key={el.id}>{el.title}</td>
  })

  const bodyResult = bodyTitle.map((el, index) => {
    return <tr key={index}>
      <td><input type="checkbox" /></td>
      {
        el.map((e) => {
          return <td key={e.id}>{e.title}</td>
        })
      }
    </tr>
  })

  return (
    // <table className='table-dashboard table-dashboard-main'>
