    //   </thead>
    //   <tbody>
    //     {bodyResult}
    //   </tbody>
    // </table>
    <table>
      <thead>
        <tr>
          <td><input type="checkbox" /></td>
          <td>One</td>
          <td>Two</td>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td><input type="checkbox" /></td>
          <td>001</td>
          <td>002</td>
        </tr>
      </tbody>
    </table>
  )
}

export default Table;
